import React,{Component} from 'react';
import { Link } from 'react-router-dom';

class AssetEditor extends Component{
  constructor(props){
      super(props)
      this.state = {
        asset:{}
      }
    }

  // componentDidMount() {
  //   fetch('https://demo.metaok.com/metacmms_prod/api/inventory/v1/assets/1456', {
  //       method: 'GET',
  //       headers: {
  //           "Content-Type": "application/json"
  //       }
  //   })
  //     .then(response => response.json())
  //     .then(data => this.setState({ asset: data }));
  // }

    render(){

      console.log(this.state.asset);

      return(
        <div className="container">
          <div className="row row-header  bg-success">
            <div className="col-lg">
              Desfibrilador Nihon kohden
            </div>
            <div className="col-lg">
              Modelo: Cardioli
            </div>
            <div className="col-lg">
              En servicio
            </div>
          </div>
          <div className="row" style={{textAlign:'center',marginTop:'20px'}}>

            <div className="col-lg">

              <div className="input-group mb-3 box-left" >
                <div className="input-group-prepend" style={{width:'35%'}}>
                  <span className="input-group-text" id="basic-addon1" style={{width:'100%'}}>SN</span>
                </div>
                <input type="text" className="form-control" disable="true"/>
              </div>

              <div className="input-group mb-3 box-left" style={{marginLeft:'5px'}}>
                <div className="input-group-prepend"  style={{width:'35%'}}>
                  <span className="input-group-text" id="basic-addon1" style={{width:'100%'}}>ID 1</span>
                </div>
                <input type="text" className="form-control"  disable="true"/>
              </div>



              <div className="input-group mb-3 box-left">
                <div className="input-group-prepend"  style={{width:'35%'}}>
                  <span className="input-group-text" id="basic-addon1" style={{width:'100%'}}>ID 2</span>
                </div>
                <input type="text" className="form-control" disable="true"/>
              </div>

              <div className="input-group mb-3 box-left" style={{marginLeft:'5px'}}>
                <div className="input-group-prepend" style={{width:'35%'}}>
                  <span className="input-group-text" id="basic-addon1" style={{width:'100%'}}>ID 3</span>
                </div>
                <input type="text" className="form-control"  disable="true"/>
              </div>

              <div className="input-group mb-3">
                <div className="input-group-prepend" style={{width:'35%'}}>
                  <span className="input-group-text" id="basic-addon1" style={{width:'100%'}}>Garant√≠a</span>
                </div>
                <input type="text" className="form-control"  disable="true"/>
              </div>

              <div className="input-group mb-3">
                <div className="input-group-prepend" style={{width:'35%'}}>
                  <span className="input-group-text" id="basic-addon1" style={{width:'100%'}}>Proximo MP</span>
                </div>
                <input type="text" className="form-control" disable="true"/>
              </div>

              <div className="input-group mb-3">
                <div className="input-group-prepend" style={{width:'35%'}}>
                  <span className="input-group-text" id="basic-addon1" style={{width:'100%'}}>Antiguedad</span>
                </div>
                <input type="text" className="form-control"  disable="true"/>
              </div>

              <div className="input-group mb-3">
                <div className="input-group-prepend" style={{width:'35%'}}>
                  <span className="input-group-text" id="basic-addon1" style={{width:'100%'}}>Propiedad</span>
                </div>
                <input type="text" className="form-control" disable="true"/>
              </div>


            </div>
          </div>

          <div className="row" style={{marginTop:'20px'}}>
            <div className="col-md-4" style={{textAlign:'center'}}>
              <Link to="/requestEditor"><button type="button" className="btn btn-outline-primary btn-lg btn-full">Solicitar MC</button></Link>
            </div>
            <div className="col-md-4" style={{textAlign:'center',marginTop:'20px'}}>
              <Link to="/"><button type="button" className="btn btn-outline-warning btn-lg btn-full" >Historial</button></Link>
            </div>
            <div className="col-md-4" style={{textAlign:'center',marginTop:'20px'}}>
              <Link to="/qr"><button type="button" className="btn btn-outline-secondary btn-lg btn-full">Regresar</button></Link>
            </div>
          </div>
        </div>
      )
    }
}

export default AssetEditor;
